// @flow
import { StyleSheet } from 'react-native'

const styles: any = StyleSheet.create({
  container: {
    backgroundColor: '#fafafa',
    flex: 1,
    justifyContent: 'center'
  },
  content: {
    marginHorizontal: 16
  },
  title: {
    fontSize: 48,
    fontWeight: '300',
    paddingBottom: 16,
    color: '#000'
  },
  subtitle: {
    fontSize: 32,
    fontWeight: '800',
    color: '#000'
  },
  error: {
    paddingVertical: 16
  },
  button: {
    backgroundColor: '#2196f3',
    borderRadius: 50,
    padding: 16
  },
  buttonText: {
    color: '#fff',
    fontWeight: '600',
    textAlign: 'center'
  }
})

export default styles
